// Filename - Main.jsx
import React from "react";
import mainObjects from "../main-objects"
import { Link } from "react-router-dom";

export default function Main(props) {

	function openDetails(obj) {
		console.log(obj)
	}

    const objElements = props.objects.map(object => (
		<Link to="/Details" key={object.id} >
			<button className="main--button" onClick={()=> openDetails("test")}>
				<img 
					src={require(`../images/${object.url}`)} 
					alt={object.label} 
					className="main--image"
				/>
			</button>
		</Link>
    ));

    return (
        <div className="main">
            {objElements}
        </div>
    );
}
